  <script>
    // Get all slides and buttons
    const slides = document.querySelectorAll('.custom-card-portfolio');
    const prevBtn = document.querySelector('.swiper-button-prev');
    const nextBtn = document.querySelector('.swiper-button-next');

    let currentSlide = 0;
    const slidesToShow = 3;

    // Function to show the current slide
    function showSlide(index) {
      slides.forEach((slide, i) => {
        if (i >= index && i < index + slidesToShow) {
          slide.style.display = 'block';
        } else {
          slide.style.display = 'none';
        }
      });
    }

    // Show initial slides
    showSlide(currentSlide);

    // Event listener for next button
    nextBtn.addEventListener('click', () => {
      if (currentSlide + slidesToShow < slides.length) {
        currentSlide += slidesToShow;
        showSlide(currentSlide);
      }
    });

    // Event listener for previous button
    prevBtn.addEventListener('click', () => {
      if (currentSlide - slidesToShow >= 0) {
        currentSlide -= slidesToShow;
        showSlide(currentSlide);
      }
    });
  </script>
  <script>
    document.addEventListener('DOMContentLoaded', function () {
      // Get all slides
      const slides = document.querySelectorAll('.client-custom-card-portfolio');
  
      let currentSlide = 0;
      const slidesToShow = 4;
  
      // Function to show the current slide
      function showSlide(index) {
        slides.forEach((slide, i) => {
          if (i >= index && i < index + slidesToShow) {
            slide.style.display = 'block';
          } else {
            slide.style.display = 'none';
          }
        });
      }
  
      // Function to move to the next slide
      function nextSlide() {
        currentSlide += slidesToShow;
        if (currentSlide >= slides.length) {
          currentSlide = 0; // Loop back to the first slide
        }
        showSlide(currentSlide);
      }
  
      // Automatically move to the next slide every 3 seconds
      setInterval(nextSlide, 3000);
  
      // Show initial slides
      showSlide(currentSlide);
    });
    
  </script>
  

